import axios from 'axios'
import TokenService from '@/services/TokenService';


const CAMION_API_BASE_URL = 'http://localhost:8080/api/v1/camiones'

class CamionService{
    getCamiones(){
        // Obtener el token del servicio de token
        const token = TokenService.token_generated;
        // Agregar el token a la solicitud usando la opción "headers"
        return axios.get(CAMION_API_BASE_URL, {
            headers: {
                Authorization: `Bearer ${this.token}`
            }
        });
    }
}

export default new CamionService()
